import { useState } from "react";
import { Dashboard } from "views/Dashboard";

export default function App() {
  const [currentView, setCurrentView] = useState("dashboard");
  const renderView = () => {
    switch (currentView) {
      case "dashboard":
        return <Dashboard />;
      case "login":
        return <Login />;

      default:
        return <div>Page not found</div>;
    }
  };
  return <div>{renderView()}</div>;
}

function Login() {
  return <p>Login</p>;
}
